import React from 'react';
import './OtherUser.css';

const OtherUsers = () => {
  return (
    <div>
      <div className='other-user-container'>
        <div className='other-user-avatar'>
          <img src='https://th.bing.com/th/id/OIP.K-4RqDC6zFrpAG31ayDDOgAAAA?w=213&h=213&c=7&r=0&o=5&dpr=1.4&pid=1.7' alt="Avatar" />
        </div>
        <div className='other-user-details'>
          <div className='other-user-info'>
            <p>Hardik Khandelwal</p>
          </div>
        </div>
      </div>
      <div className='divider'></div>
    </div>
  );
}

export default OtherUsers;
